import React, { useEffect, useState ,useRef} from 'react';
import axios from "axios";

const DocumentAValider = () => {

    const [listeDocValider,setDocValider]=useState([]);


    useEffect(()=>{
        axios.get("documentAValider").then((res)=>setDocValider(res.data));
     },[])
    return (
        <div>
                <h1> document a valider ohhh</h1>
                        <table className="table">
                            <thead>
                                <tr>
                                <th scope="col">#</th>
                                <th scope="col">First</th>
                                <th scope="col">Last</th>
                                <th scope="col">Handle</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                <th scope="row">1</th>
                                <td>Mark</td>
                                <td>Otto</td>
                                <td>@mdo</td>
                                </tr>
                            </tbody>
                        </table>
                {JSON.stringify(listeDocValider)}
        </div>
    );
};

export default DocumentAValider;
